import './App.css';
import milk from './assets/milk.jpg'

function App() {
  return (
    <div className="App bg-blue-200 h-screen flex items-center justify-center">
      <header className="App-header">
        <h1>My website</h1>

      <h2>My fave things</h2>
      <ul>
        <li>Cats</li>
        <li> Cloudy day</li>
        <li>Netflix</li>
      </ul>
       <img src={milk} className="logo" alt="milkchocobar"/>

      </header>
    </div>
  );
}

export default App;
